const filteredFriends = friends.filter(friend => friend.coolness > 5);

function List(props) {

  const item = props.groceries.map(groceries =>
    <li key={friend.id}>
      <List name={props.groceries[0].name}
    />
    </li>
    )
  return (
    <ul className="list-group">
      {List}
      Using the map method, render one li element displaying the text property of each grocery
      object.
    </ul>
  );
}

export default List;
